Verenigd Koninkrijk / Duitsland
Drama / Komedie
93 minuten

mooi

met Gemma Arterton, Christopher Eccleston en Terence Stamp

Het verhaal speelt zich af in Londen en gaat over de teruggetrokken en knorrige gepensioneerde Arthur die zich onder zachte dwang 
van zijn geliefde vrouw Marion aansluit bij een erg ongewoon lokaal koor. Hij leeft op gespannen voet met zijn zoon James, maar 
dankzij de charismatische koordirigente Elizabeth leert hij het leven te waarderen. Arthur zal geconfronteerd worden met de 
onderliggende krachten van zijn eigen norse persoonlijkheid op zijn hilarische, levenslustige muzikale zelfontdekking.
